description:
Оказание услуг по технической поддержке комплекса региональных информационных систем:
- «Система межведомственного электронного взаимодействия Курской области»;
- «Портал государственных и муниципальных услуг Курской области»;
- «Система исполнения услуг Курской области», включая  актуализацию модуля взаимодействия с Государственной информационной системой о государственных и муниципальных платежах по формату 3.х. версии 2.2.
